import EmployeeItem from '../../components/EmployeeItem';
import {users} from "../../utils/constants";

const Employees = () => {
  return (
    <div className='container'>
      {users.map((user) => {
        <EmployeeItem user key={user.id} />
      })}
    </div>
  );
};

export default Employees;
